import React, { useRef, useEffect } from "react";
import "./App.css";
function App() {
  const todo = useRef();

  handlechange = (e) => {
    console.log(e.target.value);
  };
  useEffect(() => {
    console.log(todo);
  });

  return (
    <div>
      <header>
        <div className="main">
          <h1 className="the-title">To-DO List</h1>
          <input type="text" className="search" placeholder="search" />
          <div className="main query">
            <ul>
              <li>
                <span>ahmed</span>
                <span>
                  <i className="far fa-trash-alt delete"></i>
                </span>
              </li>
              <li>
                <span>mohamed</span>
                <span>
                  <i className="far fa-trash-alt delete"></i>
                </span>
              </li>
              <li>
                <span>sayed</span>
                <span>
                  <i className="far fa-trash-alt delete"></i>
                </span>
              </li>
            </ul>
          </div>
          <div>
            <input
              ref={todo}
              onChange={handlechange}
              type="text"
              className="add"
              placeholder="add to-do"
            />
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
